import React, { useEffect, useState } from 'react'
import TodoContext from '../context/TodoContext'
import ShowTodos from './ShowTodos'

const Home = () => {

    const [tasks, setTasks] = useState([{
        id: 1,
        title: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Culpa optio fugiat eius a! Quisquam omnis magni nulla recusandae debitis cumque iure nesciunt ullam id consectetur? Sunt aut culpa corporis esse.',
    },
    {
        id: 2,
        title: 'Todos 2',
    }
])

    return (
        <>
            <TodoContext.Provider value={[tasks, setTasks]}>
                <div className="container max-w-md max-w-screen-md mx-auto rounded-lg shadow-md ">
                    <ShowTodos />
                </div>
            </TodoContext.Provider>
        </>
    )
}

export default Home
